import './App.css';

const iconList = [
    { id: 1, icon: "home icon" },
    { id: 2, icon: "info circle icon" },
];
function ReturnIcons() {
    return (
        <div className="navbar-icons">
            {iconList.map((classname) => (
                <div className="navbar-icon">
                    <i className={classname}></i>
                </div>
            ))}
        </div>
    );
}
function App() {
    return (
        <div className="content">
            <div className="navbar">
                <ReturnIcons />
            </div>
        </div>
    );
}

export default App;
